import React from 'react';
import './RecValue.css';


const RecValue = props => {
    function renderData() {
        return props.concepts.map(item =>
            <div key={item.id}>
            
                
            <li>{item.name}</li>
            <li>{item.value} </li>
            </div>
            )
    }
        return (
            
            <div>
            {renderData()}
            </div>
            
        )
    }


export default RecValue;
